import './App.css';
import PruebaComponent from './screens/pruebaComponent';
import Login from './screens/login';

import { BrowserRouter as Router, Route} from 'react-router-dom';

function App() {
  return (
    <Router className="App">
      <Route exact path="/">
        <PruebaComponent/>
      </Route>
      <Route exact path="/login">
        <Login/>
      </Route>
    </Router>
  );
}

export default App;
